import React from "react";
import SvgIcon from '@mui/material/SvgIcon';
import HotPeppericon from '../../images/hotpepper.svg';

export function HotPepperIcon (props) {
  return (
    <SvgIcon
      component="span"
      sx={{
        position:'relative',
        left:-10,
        top:-15,
        }}>
      <img src={HotPeppericon} alt="ロゴ" width="42" height="42"></img>
    </SvgIcon>
  );
};
